FeedPackage.ReleaseNotes:
Simple way to send emails using sendgrid using http or smtp api.
Usage:--
 sendgrid sg = new sendgrid("apiuser", "apikey", "method");
 string response = sg.sendmail("toaddress", "subject", "body", "from");
//method :-http or smtp

